import unittest
from weblyzard_api.client.external_api_ng import ExternalApiNg

'''
WEBLYZARD_API_URL=XXXXX WEBLYZARD_API_USER=XXXXXX WEBLYZARD_API_PASS=XXXXXX python3 -m pytest tests/client/test_external_api_ng.py
'''
class ExternalApiNgTest(unittest.TestCase):

    def test_hello_world(self):
        self.assertTrue(True)

    def test_submit_single_document(self):
        client = ExternalApiNg()
        response = client.submit_single_document(document=self.SINGLE_DOC)
        print(response['header'])
        self.assertIsNotNone(response['header']['{http://www.fhgr.ch/2019/integrity#}environment'])
        self.assertIsNotNone(response['header']['{http://www.fhgr.ch/2019/integrity#}corruption'])
        self.assertIsNotNone(response['header']['{http://www.fhgr.ch/2019/integrity#}humanright'])

    def test_submit_batch_documents(self):
        client = ExternalApiNg()
        response = client.submit_batch_documents(documents=[self.SINGLE_DOC, self.SINGLE_DOC])
        self.assertEqual(len(response), 2)
        self.assertIsNotNone(response[0]['header']['{http://www.fhgr.ch/2019/integrity#}environment'])
        self.assertIsNotNone(response[0]['header']['{http://www.fhgr.ch/2019/integrity#}corruption'])
        self.assertIsNotNone(response[0]['header']['{http://www.fhgr.ch/2019/integrity#}humanright'])

